function linkModal(lien,modal){
    $('#'+lien).click(function () {
        modalShow($('#'+modal));
    });
}
function linkModals(lien,modal){
    $('.'+lien).each(function(){
        $(this).click(function(){
            $('#'+modal+'_'+$(this).data('id')).modal('show');
        });
    });
}


